import React, { useState } from 'react';
import './AdminConsole.css';

function AdminConsole() {
  const [tab, setTab] = useState('users');
  const [settingsOpen, setSettingsOpen] = useState(false);

  const mockUsers = [
    { id: 1, name: 'Alice', role: 'peer' },
    { id: 2, name: 'Bob', role: 'admin' },
    { id: 3, name: 'Charlie', role: 'peer' },
  ];

  const renderContent = () => {
    switch (tab) {
      case 'users':
        return (
          <div className="admin-section">
            <h3>üë• Registered Users</h3>
            <div className="user-grid">
              {mockUsers.map(user => (
                <div key={user.id} className="user-card">
                  <h4>{user.name}</h4>
                  <p>Role: {user.role}</p>
                  <div>
                    {user.role !== 'admin' && (
                      <button>Promote to Admin</button>
                    )}
                    <button className="remove">Remove</button>
                  </div>
                </div>
              ))}
            </div>
          </div>
        );
      case 'requests':
        return (
          <div className="admin-section">
            <h3>üÜï New Access Requests</h3>
            <div className="user-card">
              <p>No pending requests.</p>
            </div>
          </div>
        );
      case 'chat':
        return (
          <div className="admin-section">
            <h3>üí¨ Peer-to-Peer Chat</h3>
            <div className="chat-box">
              <p><em>Chat module coming soon...</em></p>
            </div>
            <div className="chat-input">
              <input type="text" placeholder="Type a message..." />
              <button>Send</button>
            </div>
          </div>
        );
      case 'settings':
        return (
          <div className="admin-section">
            <h3>‚öôÔ∏è Admin Settings</h3>
            <div className="setting-dropdown">
              <label>Manage User Type: </label>
              <select>
                <option>Promote to Admin</option>
                <option>Remove User</option>
              </select>
            </div>
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <>
      <video autoPlay muted loop className="bg-video">
        <source src="/videos/admin.mp4" type="video/mp4" />
      </video>

      <div className="admin-dashboard">
        {/* Sidebar */}
        <aside className="sidebar">
          <h2>üîß Admin Panel</h2>
          <button onClick={() => setTab('users')} className={tab === 'users' ? 'active' : ''}>Users</button>
          <button onClick={() => setTab('requests')} className={tab === 'requests' ? 'active' : ''}>Requests</button>
          <button onClick={() => setTab('chat')} className={tab === 'chat' ? 'active' : ''}>Chat</button>
          <button onClick={() => setSettingsOpen(!settingsOpen)}>Settings ‚öô</button>
          {settingsOpen && (
            <>
              <button onClick={() => setTab('settings')}>General Settings</button>
              <button onClick={() => alert('Logged out')}>Log Out</button>
            </>
          )}
        </aside>

        {/* Main Section */}
        <main className="admin-main">
          {renderContent()}
        </main>
      </div>
    </>
  );
}

export default AdminConsole;
